import React, { Component } from 'react';

export default (props) => {
    return (
        <nav>
            <h2 className="logo">
                <a className="logo-link" href="#">{props.title}</a>
            </h2>
            <ul className="nav-menu">
                <li><a className="nav-menu-link" href="/">Home</a></li>
                <li><a className="nav-menu-link" href="portfolio">Portfolio</a> </li>
                <li><a className="nav-menu-link" href="support">Support</a></li>
            </ul>
        </nav>
    );
}
